export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},NlBkm82Wen:{data:{id:574,attributes:{imdbId:"tt0367594",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjcxMjg1Njg2NF5BMl5BanBnXkFtZTcwMjQ4NzMzMw@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"83%"},{Source:"Metacritic",Value:"72\u002F100"}],item_lang:{data:{id:1237,attributes:{title:c,plot:"When Willy Wonka decides to let five children into his chocolate factory, he decides to release five golden tickets in five separate chocolate bars, causing complete mayhem. The tickets start to be found, with the fifth going to a very special boy, called Charlie Bucket. With his Grandpa, Charlie joins the rest of the children to experience the most amazing factory ever. But not everything goes to plan within the factory.",slug:"charlie-and-the-chocolate-factory"}}},books:{data:[{id:4100,attributes:{title:"Charlie and the Chocolate Factory (Colour Edition)",description:"Roald Dahl's Charlie and the Chocolate Factory in glorious full colour. Mr Willy Wonka is the most extraordinary chocolate maker in the world. And do you know who Charlie is? Charlie Bucket is the hero. The other children in this book are nasty little beasts, called: Augustus Gloop - a great big greedy nincompoop; Veruca Salt - a spoiled brat; Violet Beauregarde - a repulsive little gum-chewer; Mike Teavee - a boy who only watches television. Clutching their Golden Tickets, they arrive at Wonka's chocolate factory. But what mysterious secrets will they discover? Our tour is about to begin. Please don't wander off. Mr Wonka wouldn't like to lose any of you at this stage of the proceedings . . . Look out for new Roald Dahl apps in the App store and Google Play- including the disgusting TWIT OR MISS! inspired by the revolting Twits.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=iaD7DAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2016-09-13",publisher:"Penguin UK",subtitle:""}},{id:4101,attributes:{title:c,description:"Each of five children lucky enough to discover an entry ticket into Mr. Willy Wonka's mysterious chocolate factory takes advantage of the situation in his own way.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=BwAvEAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2021-05-04",publisher:g,subtitle:"The Golden Edition"}},{id:4102,attributes:{title:c,description:"A dramatic adaptation of the story about Willy Wonka, his wondrous chocolate factory, and Charlie Bucket's good fortune offers a script complete with stage directions and suggestions for lighting, scenery, and props.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=bePYCwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2007-01-01",publisher:h,subtitle:"A Play"}},{id:4103,attributes:{title:c,description:"A stunning deluxe edition of Roald Dahl’s beloved Charlie and the Chocolate Factory, featuring —a new introduction by Lev Grossman, the #1 New York Times bestselling author of The Magicians —cover art by the award-winning cartoonist Ivan Brunetti —the original interior art from the 1964 first edition —French flaps and deckle-edged paper Twice turned into a feature film, Charlie and the Chocolate Factory is a delectable classic about a child’s dreams and the eccentric chocolate-maker who makes them come true. When Willy Wonka’s hallowed chocolate factory holds a worldwide contest awarding tours to the lucky, five children emerge as winners, including a glutton, a gum-chewing nitwit, a spoiled brat, and a TV addict. Only Charlie Bucket, the story’s earnest hero, stands to win the exotic riches of Wonka’s empire—if he avoids the pitfalls of his fellow contestants and stays true to his heart. Ingenious and entertaining, Charlie and the Chocolate Factory is a true modern classic by one of the most beloved storytellers of our time. For more than seventy years, Penguin has been the leading publisher of classic literature in the English-speaking world. With more than 1,700 titles, Penguin Classics represents a global bookshelf of the best works throughout history and across genres and disciplines. Readers trust the series to provide authoritative texts enhanced by introductions and notes by distinguished scholars and contemporary authors, as well as up-to-date translations by award-winning translators.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=EpJPEAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2011-08-30",publisher:g,subtitle:"(Penguin Classics Deluxe Edition)"}},{id:4104,attributes:{title:"Inside Charlie's Chocolate Factory",description:"This is your Golden ticket: enter the gates of Wonka's Chocolate Factory. Roald Dahl's delicious tale of Charlie Bucket and Mr Willy Wonka has been absorbed into global culture like no other story. This glorious full-colour volume explores its influence on film, theatre, music, food and beyond. Originally published fifty years ago, Charlie and the Chocolate Factory remains one of the world's most beloved children's books. www.roaldahl.com",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=juGRoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2014-09-04",publisher:h,subtitle:"The Complete Story of Roald Dahl's Most Famous Creation"}}]}}},meta:{}}},prerenderedAt:1681703508229}}("Roald Dahl","movie","Charlie and the Chocolate Factory",null,"series",1,"Penguin","Puffin"))